cription": { "type": "string", "description": "Description of the serialized taxonomy. At most 2000 bytes when encoded in UTF-8. If not set, defaults to an empty description." } } }, "GoogleCloudDatacatalogV1EntryOverview": { "properties": { "overview": { "description": "Entry overview with support for rich text. The overview must only contain Unicode characters, and should be formatted using HTML. The maximum length is 10 MiB as this value holds HTML descriptions including encoded images. The maximum length of the text without images is 100 KiB.", "type": "string" } }, "description": "Entry overview fields for rich text descriptions of entries.", "id": "GoogleCloudDatacatalogV1EntryOverview", "type": "object" }, "GoogleCloudDatacatalogV1StorageProperties": { "description": "Details the properties of the underlying storage.", "properties": { "fileType": { "description": "File type in MIME format, for example, `text/plain`.", "type": "string" }, "filePattern": { "type": "array", "items": { "type": "string" }, "description": "Patterns to identify a set of files for this fileset. Examples of a valid `file_pattern`: LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh `gs://bucket_name/dir/*`: matches all files in the `bucket_name/dir` directory LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh `gs://bucket_name/dir/**`: matches all files in the `bucket_name/dir` and all subdirectories recursively LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh `gs://bucket_name/file*`: matches files prefixed by `file` in `bucket_name` LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-g