his taxonomy.", "format": "int32", "type": "integer", "readOnly": true }, "displayName": { "type": "string", "description": "Required. User-defined name of this taxonomy. The name can't start or end with spaces, must contain only Unicode letters, numbers, underscores, dashes, and spaces, and be at most 200 bytes long when encoded in UTF-8. The taxonomy display name must be unique within an organization." }, "description": { "description": "Optional. Description of this taxonomy. If not set, defaults to empty. The description must contain only Unicode characters, tabs, newlines, carriage returns, and page breaks, and be at most 2000 bytes long when encoded in UTF-8.", "type": "string" }, "activatedPolicyTypes": { "items": { "type": "string", "enumDescriptions": [ "Unspecified policy type.", "Fine-grained access control policy that enables access control on tagged sub-resources." ], "enum": [ "POLICY_TYPE_UNSPECIFIED", "FINE_GRAINED_ACCESS_CONTROL" ] }, "description": "Optional. A list of policy types that are activated for this taxonomy. If not set, defaults to an empty list.", "type": "array" }, "name": { "description": "Output only. Resource name of this taxonomy in URL format. Note: Policy tag manager generates unique taxonomy IDs.", "readOnly": true, "type": "string" } }, "id": "GoogleCloudDatacatalogV1Taxonomy", "description": "A taxonomy is a collection of hierarchical policy tags that classify data along a common axis. For example, a \"data sensitivity\" taxonomy might contain the following policy tags: ``` + PII + Account number + Age + SSN + Zipcode + Financials + Revenue ``` A \"data origin\" taxonomy might contain the following policy tags: ``` + User data + Employee data + Partner data + Public data ```", "type": "object" }, "GoogleCloudDatacatalogV1DataSourceConnectionSpec": { "properties": { "bigqueryConnectionSpec": { "$ref": "GoogleCloudDatacatalogV1BigQueryConnectionSpec", "description": "Fields specific to BigQuery connections." } }, "id": "GoogleCloudDatacatalogV1DataSourceConnectionSpec", "type": "object", "description": "Specification that applies to a data source connection. Valid only for entries with the `DATA_SOURCE_CONNECTION` type." }, "GoogleCloudDatacatalogV1ListTaxonomiesResponse": { "properties": { "taxonomies": { "description": "Taxonomies that the project contains.", "type": "array", "items": { "$ref": "GoogleCloudDatacatalogV1Taxonomy" } }, "nextPageToken": { "type": "string", "description": "Pagination token of the next results page. Empty if there are no more results in the list." } }, "type": "object", "id": "GoogleCloudDatacatalogV1ListTaxonomiesResponse", "description": "Response message for ListTaxonomies." }, "GoogleCloudDatacatalogV1ImportTaxonomiesResponse": { "id": "GoogleCloudDatacatalogV1ImportTaxonomiesResponse", "description": "Response message for ImportTaxonomies.", "type": "object", "properties": { "taxonomies": { "type": "array", "description": "Imported taxonomies.", "items": { "$ref": "GoogleCloudDatacatalogV1Taxonomy" } } } }, "GoogleCloudDatacatalogV1SearchCatalogRequestScope": { "description": "The criteria that select the subspace used for query matching.", "type": "object", "id": "GoogleCloudDatacatalogV1SearchCatalogRequestScope", "properties": { "starredOnly": { "description": "Optional. If `true`, search only among starred entries. By default, all results are returned, starred or not.", "type": "boolean" }, "restrictedLocations": { "items": { "type": "string" }, "type": "array", "description": "Optional. The list of locations to search within. If empty, all locations are searched. Returns an error if any location in the list isn't one of the [Supported regions](https://cloud.google.com/data-catalog/docs/concepts/regions#supported_regions). If a location is unreachable, its name is returned in the `SearchCatalogResponse.unreachable` field. To get additional information on the error, repeat the search request and set the location name as the value of this parameter." }